import style  from "./crud.module.css"
import axios from "axios"
import { useEffect, useState } from "react"
const Users=()=>{
    let [user,setUser]=useState([])
    useEffect(()=>{
        axios.get("http://localhost:3004/employees")
        .then((response)=>{setUser(response.data)})
        .catch(()=>{console.log("error");})
    })
    return(
       
        <div id={style.user}>
            <tr>
                <thead>
             <th >NAME</th>
             <th >SALARY</th>
             <th >COMPANY</th>
             <br/><br/>
             </thead>
             </tr>
            <tbody>
            {user.map((detail)=>{
               return(
            <div> 
                <tr>
               <td id={style.first_h2} key={detail.id}>{detail.empName}</td>
               <td key={detail.id}>{detail.empSalary}</td>
               <td key={detail.id}>{detail.empCompany}</td>
               </tr>
            </div>)
            })}
           </tbody>


        </div>
    )
}
export default Users
